INSERT INTO `option` (`id`, `value`) VALUES
	(11, 'A、8；8；4 B、9；8；3 C、10；9；4 D、8；8；3'),
	(12, 'A、读者第一，服务至上 B、一切为了读者，一切方便读者 C、育人为本，读者至上 D、加强图书馆系统建设，促进服务质量提高'),
	(13, 'A、周一下午2：30——6：00 B、周二下午2：30——6；00 C、周三下午2：30——6：00 D、周五下午2：30——6：00'),
	(14, 'A、保持馆内卫生、整洁；不随地吐痰、乱扔杂物；不在馆内进餐、吃零食；不带宠物入馆。 B、图书馆是重点防火单位，严禁携带易燃易爆物品入馆，严禁在馆内任何地方吸烟。 C、爱护馆内书刊、设备及其他设施，禁止涂抹刻画等污损、破坏行为；馆内公物（包括书刊、设备等）未办理借出手续，严禁私自带出； D、维护馆内秩序，不随意挪动阅览桌椅，但可以用物品占阅览座位。'),
	(15, 'A、本科生的借书期限为一个月。所借图书逾期，按逾期的实际天数，以每日每册0.10元累计计算逾期款； B、阅览室的书刊只能在室内阅览，不能外借，但可以借出复印，且须当班归还； C、撕页、剪裁或污损严重，影响书刊完整及阅读者，仅须赔偿相同书刊，无需缴纳书刊加工费； D、遗失图书，可以购回与原书相同版本或再版的图书，还需缴纳书刊加工费。'),
	(16, 'A、2元 B、5元 C、10元 D、15元'),
	(17, 'A、图书馆 B、计财处卡务中心 C、学生处 D、后勤服务中心'),
	(18, 'A、http://10.1.1.1/tsg B、http://www.huhst.edu.cn/tsg C、http://www.huhst.edu.com D、http://www.huhst.edu.cn'),
	(19, 'A、身份证 B、学生证 C、校园一卡通 D、以上都不对'),
	(20, 'A、直接访问图书馆网站； B、通过登录移动图书馆； C、通过购买数据库账号； D、以上说法都不对'),
	(21, 'A、电子图书 B、电子期刊 C、电子图书和电子期刊 D、电子标准'),
	(22, 'A、4月21日 B、4月22日 C、4月23日 D、4月24日'),
	(23, 'A、检索图书馆书目； B、下载电子图书； C、查询读者借书信息； D、向图书馆荐购图书。'),
	(24, 'A、条码 B、分类号 C、索书号 D、顺序号'),
	(25, 'A、TN410.2 B、TN410.2/193 C、T1000789 D、978-7-122-07626-7'),
	(26, 'A、图书馆藏书排架用的编码，又称索取号，是文献外借和馆藏清点的主要依据； B、一般由分行排列的几组号码组成，我馆藏书索书号贴在书脊下方的书标上； C、一个索书号只能代表一种书； D、一个索书号只能代表一本书。'),
	(27, 'A、1 B、2 C、5 D、10'),
	(28, 'A、6 B、8 C、10 D、12'),
	(29, 'A、7 B、14 C、30 D、60'),
	(30, 'A、图书不能办续借； B、每本图书只能续借1次； C、每本图书能续借2次； D、以上说法都不对。'),
	(31, 'A、不需要支付超期款，因为寒、暑假期间到期图书可于开学后两周内归还，不算超期； B、0.2元； C、0.3元； D、以上说法都不对。'),
	(32, 'A、身份证号后六位、六个0； B、学生证号、身份证后六位； C、一卡通号上的学号、四个0； D、一卡通号后六位、身份证后六位。'),
