	(71, 'A、军事 B、哲学 C、艺术 D、文学'),
	(72, 'A、学术期刊阅览室收藏用于学术研究的当年度期刊；现刊阅览室收藏当年度的休闲娱乐型期刊。 B、学术期刊阅览室不仅收藏当年的学术性期刊，也收藏往年的学术性期刊；现刊阅览室只收藏当年的期刊 C、学术期刊阅览室只对教师开放，现刊阅览室对师生都开放。 D、没什么不同。'),
	(73, 'A、“（七）”代表架号，“5”代表层号 B、“（七）”代表分类号，“5”代表种次号 C、“（七）”代表编号，“5”代表邮发代号 D、以上说法都不对'),
	(74, 'A、阅览报纸时，必须将报纸和报夹一同取走，再按报夹上的编号归位。 B、阅览过刊时，必须使用代书板。 C、更新下来的往日报纸，放在书架上，可以随意阅览。 D、找到有用的资料，在阅览室老师许可的情况下，可以将报纸或过刊借出复印。'),
	(75, 'A、不需要使用代书板 B、阅过后的期刊不放回原处，直接放阅览桌上即可。 C、阅过后的期刊必须放回原处，还回时注意期刊上书标的代码与期刊架上的代码一致。 D、期刊架搁板上的期刊可以阅览，掀开搁板，里面的期刊也可以阅览，但必须按原样归位。'),
	(76, 'A、污损程度轻的，不做处罚； B、污损程度严重、无法修补的，按遗失书刊的规定处理。 C、污损或破坏条形码者，每条赔偿5元。 D、损坏书中磁条者，除作出书面检讨外，按20元/册予以处罚。'),
	(77, 'A、人才 B、商品 C、中国学术期刊 D、统计'),
	(78, 'A、读者可以使用电子阅览室的电脑进行资料查询下载、文稿录入、视频观看、浏览新闻等事务。 B、凭校园一卡通使用电子阅览室的电脑，按1元/小时收取工本费。 C、目前电子阅览室周一至周日都开放，开放时间为上午8:20----12:00，下午14:30----17:30。 D、电子阅览室的电脑全部免费使用，不收取任何费用。'),
	(79, 'A、TP316.7/215，TP391.41/1093，TP391.4/1094，TP393/293， B、TP316.7/215，TP391.4/1094，TP391.41/1093，TP393/293， C、TP316.7/215，TP393/293，TP391.41/1093，TP391.4/1094， D、TP393/293，TP316.7/215，TP391.4/1094，TP391.41/1093，'),
