	(119, 'A、我校本专科生读者借书数量为8册，研究生读者借书数量为10册。 B、我校本专科生所借图书的借阅期限为1个月，还可以续借一次，续借期也为1个月。 C、我校研究生所借图书的借阅期限为6个月，还可续借一次，续借期也为6个月。 D、读者赔款后，又找回原书，赔书款可如数退还本人。'),
