	(124, 'A、登录“我的图书馆”，进入“读者荐购”，填写所需书刊信息并提交。 B、到图书馆文献资源建设部[６０５室]找老师，当面提交申请。 C、登录图书馆网站主页，点击“读者荐购”栏目，填写所需书刊信息并提交。 D、找图书馆的任何老师都可以进行书刊荐购。'),
	(125, 'A、登录图书检索系统，网址为http://10.15.11.5:8088/opac，输入读者卡号和密码，点击“登录”即可。 B、读者卡号为一卡通上的学号，初始密码为００００。 C、用户可以更改登录密码，更改方式为点击登录页面里的“密码更改”选项，按提示进行。 D、进入图书馆主页，点击“我的图书馆”栏目，输入读者卡号和密码进行登录。'),
	(126, 'A、登录图书馆主页，选择“书目查询”检索，查到该书的馆藏地点和索书号，到馆借出。 B、下载超星移动图书馆到用户的移动终端，搜索该书，下载阅读。 C、利用图书馆主页的“读秀学术搜索”，找到该书，进行在线阅读。 D、通过图书馆大厅的歌德电子图书借阅机获取。'),
	(127, 'A、办公室：负责全馆行政工作及各部门之间的协调。 B、文献资源建设部：负责文献的采购、荐购、捐赠、整理、调拨工作。 C、文献借阅部：负责图书的保管、外借和还回。 D、网络信息部：负责计算机等现代技术应用系统的正常运行与维护，以及电子阅览室管理等。 E、读者服务部：负责本馆的读者咨询工作，定期召开读者座谈会、组织读者问卷调查、统计和分析、开展读者活动、借阅随书光盘等工作。'),
	(128, 'A、借阅预约罚金查询 B、借阅罚金历史 C、登录密码更改 D、个人信息更改 E、书刊荐购 F、借阅历史查询'),
	(129, 'A、题名 B、作者 C、出版社 D、主题词 E、索书号 F、馆藏地点'),
	(130, 'A、需持本人一卡通上机，基本上机费为１元／小时。 B、严禁读者安装、复制游戏程序到电子阅览室的电脑上。 C、严禁读者删改室内电脑系统配置及文件。 D、使用电子阅览室电脑收发电子邮件或从事贸易活动而引起的法律纠纷问题由读者自行负责。'),
	(131, 'A、自习室严禁占座位。空位半小时以上，无论桌上是否有书籍，他人都有权使用该座位。 B、保持室内安静，不得大声喧哗。 C、自习室节假日都开放。 D、暑假有自习室开放，寒假自习室都不开放。 E、每学期末，放在自习室内的个人书籍及物品必须全部带走，图书馆会对自习室进行全面清理维护。 F、读者在自习室内自习，必须做到人走书走。未遵守自习室管理规定的读者造成的书籍、文具等个人物品丢失，责任自负。'),
	(132, 'A、污损程度轻的，罚款2-10元。 B、污损程度较重、但内容完整、修补后可继续流通的，除支付罚款外，还须赔偿修补费5元。 C、污损程度严重、无法修补的，按遗失书刊的规定处理。 D、污损或破坏条形码者，每条赔偿5元。 E、损坏书中磁条者，除作出书面检讨外，按20元/册予以处罚。'),
	(133, 'A、登录http://www.hnadl.cn网站，点击相关资源链接。 B、登录http://hn.hnadl.cn网站，点击相关资源链接。 C、登录http://www.hnadl.com网站，点击相关资源链接。 D、在图书馆主页上点击湖南省高校数字图书馆链接进入。'),
