	(187, 'A、保持馆内卫生、整洁；不随地吐痰、乱扔杂物；不在馆内进餐、吃零食；不带宠物入馆。 B、图书馆是重点防火单位，严禁携带易燃易爆物品入馆，严禁在馆内任何地方吸烟。 C、爱护馆内书刊、设备及其他设施，禁止涂抹刻画等污损、破坏行为；馆内公物（包括书刊、设备等）未办理借出手续，严禁私自带出； D、维护馆内秩序，不随意挪动阅览桌椅，但可以用物品占阅览座位。'),
	(188, 'A、本科生的借书期限为一个月。所借图书逾期，按逾期的实际天数，以每日每册0.10元累计计算逾期款； B、阅览室的书刊只能在室内阅览，不能外借，但可以借出复印，且须当班归还； C、撕页、剪裁或污损严重，影响书刊完整及阅读者，仅须赔偿相同书刊，无需缴纳书刊加工费； D、遗失图书，可以购回与原书相同版本或再版的图书，还需缴纳书刊加工费。'),
