	(219, 'A、每本书0.05元/天 B、每本书0.10元/天 C、每本书0.15元/天 D、每本书0.20元/天'),
	(220, 'A、遗失1995年后出版的中文图书，无法按规定购回，按图书价格的3倍赔偿； B、遗失1995年前出版的中文图书，无法按规定购回，按图书价格的5倍赔偿； C、遗失珍本、孤本图书，无法按规定购回，按图书价格的10倍赔偿； D、无论遗失何种书籍，只要照价赔偿就行。'),
	(221, 'A、图书馆还书总台 B、计财处卡务中心 C、图书馆读者服务部 D、图书馆馆办公室'),
	(222, 'A、查看通知公告 B、查询馆藏书目 C、搜索学术资源 D、预约自习座位'),
