	(227, 'A、 B、清大新洋 C、LINUX D、以上都不是'),
	(228, 'A、安装在图书馆二楼大厅； B、需要安装超星移动图书馆客户端在移动终端上方可下载阅读； C、只需在电子书借阅机屏幕上选择图书，扫描图书二维码，便可将该书下载至手机阅读； D、用户需要在电子借阅机上注册后方可下载图书。'),
	(229, 'A、标题 B、关键词 C、著者 D、以上都不是'),
	(230, 'A、中国图书馆分类法 B、杜威分类法 C、科图法 D、以上都不是'),
	(231, 'A、现刊阅览室、报纸过刊阅览室、电子阅览室双休日照常开放。 B、所有借阅区双休日都不开放。 C、自习室周一至周日从早上8：00——晚上10：00连续开放。 D、密集书库的图书可以到文献借阅部主任处办理外借手续。'),
	(232, 'A、H类 B、I类 C、B类 D、X类'),
	(233, 'A、文学 B、语言 C、艺术 D、经济'),
	(234, 'A、本人校园一卡通 B、本人身份证 C、本人学生证 D、以上都不是'),
	(235, 'A、读者进入书库借书，进入阅览室阅览报刊，可以直接取阅架上的图书和报刊，不需要使用代书板。 B、读者凭一卡通使用电子阅览室的电脑，收费标准为2元/小时。 C、读者要查看随书光盘，既可以在书目查询系统里下载，也可以到图书馆305室借阅实体光盘。 D、读者如果想获得我馆没有购买全文的资源，只能自己付费去网上购买。'),
	(236, 'A、 T、 U、 O、X B、 T、 O、 U、X C、 X、 T、 U、O D、 O、 U、 X、T'),
