	(289, 'A、查询馆藏书目 B、检索学术资源 C、收看学术视频 D、阅读报纸 E、订阅资讯'),
	(290, 'A、超星电子图书 B、书生之家 C、中国数字图书馆综合平台 D、优阅外文电子图书 E、读秀学术搜索'),
	(291, 'A、还书服务 B、办理续借手续 C、综合咨询服务 D、一卡通的开通、挂失 E、遗失、污损、超期图书罚款'),
	(292, 'A、我校本专科生读者借书数量为8册，研究生读者借书数量为10册。 B、我校本专科生所借图书的借阅期限为1个月，还可以续借一次，续借期也为1个月。 C、我校研究生所借图书的借阅期限为6个月，还可续借一次，续借期也为6个月。 D、读者赔款后，又找回原书，赔书款可如数退还本人。'),
	(293, 'A、中国期刊全文数据库 B、中国年鉴网络出版总库 C、中国重要报纸全文数据库 D、中国重要会议全文数据库'),
