	(295, 'A、博看网 B、报纸过刊阅览室 C、电子阅报机 D、超星移动图书馆'),
	(296, 'A、微信平台公众号 B、CＮＫＩ中国知网 C、网上报告厅 D、超星移动图书馆'),
	(297, 'A、图书馆主页 B、图书馆电子大屏幕 C、图书馆微信平台 D、真人图书馆群（群号为：136308633） E、宣传海报'),
	(298, 'A、登录“我的图书馆”，进入“读者荐购”，填写所需书刊信息并提交。 B、到图书馆文献资源建设部[６０５室]找老师，当面提交申请。 C、登录图书馆网站主页，点击“读者荐购”栏目，填写所需书刊信息并提交。 D、找图书馆的任何老师都可以进行书刊荐购。'),
	(299, 'A、登录图书检索系统，网址为http://10.15.11.5:8088/opac，输入读者卡号和密码，点击“登录”即可。 B、读者卡号为一卡通上的学号，初始密码为００００。 C、用户可以更改登录密码，更改方式为点击登录页面里的“密码更改”选项，按提示进行。 D、进入图书馆主页，点击“我的图书馆”栏目，输入读者卡号和密码进行登录。'),
	(300, 'A、登录图书馆主页，选择“书目查询”检索，查到该书的馆藏地点和索书号，到馆借出。 B、下载超星移动图书馆到用户的移动终端，搜索该书，下载阅读。 C、利用图书馆主页的“读秀学术搜索”，找到该书，进行在线阅读。 D、通过图书馆大厅的歌德电子图书借阅机获取。'),
	(301, 'A、办公室：负责全馆行政工作及各部门之间的协调。 B、文献资源建设部：负责文献的采购、荐购、捐赠、整理、调拨工作。 C、文献借阅部：负责图书的保管、外借和还回。 D、网络信息部：负责计算机等现代技术应用系统的正常运行与维护，以及电子阅览室管理等。 E、读者服务部：负责本馆的读者咨询工作，定期召开读者座谈会、组织读者问卷调查、统计和分析、开展读者活动、借阅随书光盘等工作。'),
	(302, 'A、借阅预约罚金查询 B、借阅罚金历史 C、登录密码更改 D、个人信息更改 E、书刊荐购 F、借阅历史查询'),
	(303, 'A、题名 B、作者 C、出版社 D、主题词 E、索书号 F、馆藏地点'),
	(304, 'A、需持本人一卡通上机，基本上机费为１元／小时。 B、严禁读者安装、复制游戏程序到电子阅览室的电脑上。 C、严禁读者删改室内电脑系统配置及文件。 D、使用电子阅览室电脑收发电子邮件或从事贸易活动而引起的法律纠纷问题由读者自行负责。'),
	(305, 'A、自习室严禁占座位。空位半小时以上，无论桌上是否有书籍，他人都有权使用该座位。 B、保持室内安静，不得大声喧哗。 C、自习室节假日都开放。 D、暑假有自习室开放，寒假自习室都不开放。 E、每学期末，放在自习室内的个人书籍及物品必须全部带走，图书馆会对自习室进行全面清理维护。 F、读者在自习室内自习，必须做到人走书走。未遵守自习室管理规定的读者造成的书籍、文具等个人物品丢失，责任自负。'),
	(306, 'A、污损程度轻的，罚款2-10元。 B、污损程度较重、但内容完整、修补后可继续流通的，除支付罚款外，还须赔偿修补费5元。 C、污损程度严重、无法修补的，按遗失书刊的规定处理。 D、污损或破坏条形码者，每条赔偿5元。 E、损坏书中磁条者，除作出书面检讨外，按20元/册予以处罚。'),
	(307, 'A、登录http://www.hnadl.cn网站，点击相关资源链接。 B、登录http://hn.hnadl.cn网站，点击相关资源链接。 C、登录http://www.hnadl.com网站，点击相关资源链接。 D、在图书馆主页上点击湖南省高校数字图书馆链接进入。'),
	(308, 'A、登录“移动图书馆”办理续借 B、去图书馆办理续借手续 C、登录“我的图书馆”在网上自己办理续借 D、还回去，不看了 E、通过我馆微信公众号办理续借'),
	(309, 'A、向图书馆老师直接提出 B、在图书馆主页点击“留言”栏提交 C、将建议写在纸条上投入还书总台旁的读者意见箱 D、在馆长接待日（每周五上午）去馆长办公室反映'),
	(310, 'A、中国小说 B、中国报告文学 C、中国散文 D、欧美文学'),
	(311, 'A、除中国小说、中国报告文学、中国散文外的所有文学类书籍 B、欧洲文学 C、美洲文学 D、非洲文学 E、大洋洲文学'),
	(312, 'A、马克思、恩格斯、列宁、斯大林、毛泽东、邓小平的著作 B、哲学、宗教著作 C、社会科学总论 D、历史、地理著作'),
	(313, 'A、政治与法律书籍 B、军事著作 C、经济学著作 D、文学著作'),
	(314, 'A、英语过级图书 B、汉语学习图书 C、语言文字类字典、词典 D、法语、日语、德语等各国语言学习辅导书'),
	(315, 'A、与文化有关的各种图书 B、与教育有关的图书 C、与体育相关的各种图书 D、艺术类书籍'),
	(316, 'A、数理化图书 B、农业与生物科学图书 C、天文学与环境安全科学图书 D、工业技术类图书'),
	(317, 'A、能源与动力工程图书 B、电子学与电信技术图书 C、自动化与计算机图书 D、服装、美食、家庭装修类图书'),
	(318, 'A、阅览报纸 B、阅览过刊 C、自习 D、外借图书'),
	(319, 'A、阅览学术研究型期刊 B、自习 C、外借图书 D、阅览休闲娱乐类杂志'),
	(320, 'A、到图书馆读者服务部（305室）借阅实体光盘 B、到图书所在的借阅区借阅 C、通过“书目查询”栏目显示有随书附碟的可到网上下载查阅 D、到文献资源建设部借阅'),
	(321, 'A、查询书目，确定书库 B、浏览书架上的类别标识牌，确定书架 C、面对书架，按照从左到右、从上到下的顺序查找 D、随意浏览，找到想要的书就办理借阅手续'),
	(322, 'A、“我的图书馆” B、超星移动图书馆； C、图书馆主页“书目查询”检索； D、图书馆微信公众号。'),
	(323, 'A、8；8；4 B、9；8；3 C、10；9；4 D、8；8；3'),
	(324, 'A、读者第一，服务至上 B、一切为了读者，一切方便读者 C、育人为本，读者至上 D、加强图书馆系统建设，促进服务质量提高'),
	(325, 'A、周一下午2：30——6：00 B、周二下午2：30——6；00 C、周三下午2：30——6：00 D、周五下午2：30——6：00'),
	(326, 'A、保持馆内卫生、整洁；不随地吐痰、乱扔杂物；不在馆内进餐、吃零食；不带宠物入馆。 B、图书馆是重点防火单位，严禁携带易燃易爆物品入馆，严禁在馆内任何地方吸烟。 C、爱护馆内书刊、设备及其他设施，禁止涂抹刻画等污损、破坏行为；馆内公物（包括书刊、设备等）未办理借出手续，严禁私自带出； D、维护馆内秩序，不随意挪动阅览桌椅，但可以用物品占阅览座位。'),
	(327, 'A、本科生的借书期限为一个月。所借图书逾期，按逾期的实际天数，以每日每册0.10元累计计算逾期款； B、阅览室的书刊只能在室内阅览，不能外借，但可以借出复印，且须当班归还； C、撕页、剪裁或污损严重，影响书刊完整及阅读者，仅须赔偿相同书刊，无需缴纳书刊加工费； D、遗失图书，可以购回与原书相同版本或再版的图书，还需缴纳书刊加工费。'),
	(328, 'A、2元 B、5元 C、10元 D、15元'),
