	(338, 'A、图书馆藏书排架用的编码，又称索取号，是文献外借和馆藏清点的主要依据； B、一般由分行排列的几组号码组成，我馆藏书索书号贴在书脊下方的书标上； C、一个索书号只能代表一种书； D、一个索书号只能代表一本书。'),
