	(359, 'A、遗失1995年后出版的中文图书，无法按规定购回，按图书价格的3倍赔偿； B、遗失1995年前出版的中文图书，无法按规定购回，按图书价格的5倍赔偿； C、遗失珍本、孤本图书，无法按规定购回，按图书价格的10倍赔偿； D、无论遗失何种书籍，只要照价赔偿就行。'),
