	(367, 'A、安装在图书馆二楼大厅； B、需要安装超星移动图书馆客户端在移动终端上方可下载阅读； C、只需在电子书借阅机屏幕上选择图书，扫描图书二维码，便可将该书下载至手机阅读； D、用户需要在电子借阅机上注册后方可下载图书。'),
