	(369, 'A、中国图书馆分类法 B、杜威分类法 C、科图法 D、以上都不是'),
	(370, 'A、现刊阅览室、报纸过刊阅览室、电子阅览室双休日照常开放。 B、所有借阅区双休日都不开放。 C、自习室周一至周日从早上8：00——晚上10：00连续开放。 D、密集书库的图书可以到文献借阅部主任处办理外借手续。'),
