	(374, 'A、读者进入书库借书，进入阅览室阅览报刊，可以直接取阅架上的图书和报刊，不需要使用代书板。 B、读者凭一卡通使用电子阅览室的电脑，收费标准为2元/小时。 C、读者要查看随书光盘，既可以在书目查询系统里下载，也可以到图书馆305室借阅实体光盘。 D、读者如果想获得我馆没有购买全文的资源，只能自己付费去网上购买。'),
