	(387, 'A、不需要使用代书板 B、阅过后的期刊不放回原处，直接放阅览桌上即可。 C、阅过后的期刊必须放回原处，还回时注意期刊上书标的代码与期刊架上的代码一致。 D、期刊架搁板上的期刊可以阅览，掀开搁板，里面的期刊也可以阅览，但必须按原样归位。'),
	(388, 'A、污损程度轻的，不做处罚； B、污损程度严重、无法修补的，按遗失书刊的规定处理。 C、污损或破坏条形码者，每条赔偿5元。 D、损坏书中磁条者，除作出书面检讨外，按20元/册予以处罚。'),
