	(390, 'A、读者可以使用电子阅览室的电脑进行资料查询下载、文稿录入、视频观看、浏览新闻等事务。 B、凭校园一卡通使用电子阅览室的电脑，按1元/小时收取工本费。 C、目前电子阅览室周一至周日都开放，开放时间为上午8:20----12:00，下午14:30----17:30。 D、电子阅览室的电脑全部免费使用，不收取任何费用。'),
