	(264, 'A', '11、读者可以登录图书馆主页，获知节假日开馆时间、活动信息、数据库试用的最新消息。这种说法（ ） 。', 'desc', '2016-05-04', 264, NULL),
	(265, 'A', '12、“真人图书馆”是由我馆主办、大学生科技协会承办的一个以真人为图书，通过面对面交流的方式阅读真人独特人生故事的活动。这种说法（ ） 。', 'desc', '2016-05-04', 265, NULL),
	(266, 'A', '13、“教授博士名家讲坛”是我馆举办的一个学术讲座栏目，通常在图书馆415学术交流中心进行，届时会在图书馆大厅入口处张贴活动海报，在图书馆网站、电子显示屏、微信平台上发布活动信息，有兴趣的老师和学生都可以参加。这种说法（ ） 。', 'desc', '2016-05-04', 266, NULL),
