	(268, 'A', '15、我校师生如果要向图书馆捐赠图书，应该联系图书馆馆办公室或文献资源建设部。这种说法（ ） 。', 'desc', '2016-05-04', 268, NULL),
	(269, 'A', '16、图书馆是重点防火单位，严禁携带易燃易爆物品入馆，严禁在馆内任何地方吸烟、用火。这种说法（ ） 。', 'desc', '2016-05-04', 269, NULL),
