	(272, 'A', '19、“文学名著电影欣赏节”是我校图书馆举办的一项融名著阅读、电影欣赏、影评书评征文于一体的阅读推广活动。这种说法（ ） 。', 'desc', '2016-05-04', 272, NULL),
