	(275, 'A', '22、我馆图书在书架上的排列位置先按分类号排列，分类号相同再按种次号大小排列。这种说法（ ） 。', 'desc', '2016-05-04', 275, NULL),
	(276, 'A', '23、图书馆图书排序的一般规律是先按照分类号排序，其规则是对同级类目进行一对一的比较和排序，而不是完全按照数字的大小顺序来排序。比如，H12和H3，在这两个分类号中，H是一级类目[即语言学类]，1和3是二级类目，2是三级类目。因此，对这两个分类号的排序方式是，将H1和H3进行比较，H12排在H3的前面。这种说法（ ） ', 'desc', '2016-05-04', 276, NULL),
	(277, 'A', '24、我馆自习室暑假开放，寒假不开放。这种说法（ ） 。', 'desc', '2016-05-04', 277, NULL),
	(278, 'B', '25、我馆图书借还实行分借分还书制。这种说法（ ） 。', 'desc', '2016-05-04', 278, NULL),
	(279, 'A', '26、读者所借图书，可以续借一次，续借手续应在图书到期日前办理。续借手续可以在大厅还书总台办理，也可以登录“我的图书馆”或通过我馆微信公众号自行办理。这种说法（ ） 。', 'desc', '2016-05-04', 279, NULL),
	(280, 'A', '27、图书馆十分重视读者对图书及期刊的推荐意见。读者可直接来图书馆文献资源建设部（图书馆605室）推荐图书，也可通过图书馆主页上的读者荐购栏目提供推荐信息。这种说法（ ） 。', 'desc', '2016-05-04', 280, NULL),
	(281, 'A', '28、我馆对图书的分类采用《中国图书馆图书分类法》（简称《中图法》）。《中图法》把所有学科分为五个基本部类，在此基础上展开为22个基本大类，用22个大写汉语拼音字母来标记，如：文学类图书为“I”；数理化类图书为“O”；计算机类图书为“TP”等。这种说法（ ） ', 'desc', '2016-05-04', 281, NULL),
	(282, 'A', '29、图书经过分类后，同一门类的图书排列在一起，性质相近的图书互相联系，读者要想借阅哪方面的图书，便可按类查找，并可从分类体系中了解到内容相近的其他图书。这种说法（ ） ', 'desc', '2016-05-04', 282, NULL),
	(283, 'A', '30、《微机使用技巧与实用程序》的索书号是TP3/156，“TP3”是该书的分类号→表示该书所属的类目：计算机技术；“156”是“TP3”的第156种图书→表示该书在同一种类（TP3）图书中的排架顺序号。这种说法（ ） ', 'desc', '2016-05-04', 283, NULL),
	(284, 'A', '31、图书馆的所有图书都是按索书号顺序从左到右、从上到下进行排架。排序的一般规律是先按照分类号排序，然后再按照种次号排序。种次号表示的是同类图书到馆的先后次序，排架时按照数字的大小顺序，从小到大排列。如索书号为I247.5/23的图书排在索书号为I247.5/21的后面。这种说法（ ） 。', 'desc', '2016-05-04', 284, NULL),
	(285, 'A', '32、图书馆主要通过面对面咨询、邮件咨询、电话咨询、留言板、FAQ等服务方式来解答读者在使用图书馆时所遇到的问题。这种说法（ ） 。', 'desc', '2016-05-04', 285, NULL),
	(286, 'A', '33、对读者经常会遇到并提问的问题，图书馆已经整理了“常见问题（FAQ）”、“电子资源利用（FAQ）”、“流通阅览（FAQ）”，读者可以从这些FAQ中找到某些问题的答案。这种说法（ ） 。', 'desc', '2016-05-04', 286, NULL),
	(287, 'A', '34、读者在进行书目查询时，应该记录书名、馆藏地点、索书号等图书信息，再到相应的馆藏地点取书并办理借书手续。这种说法（ ） 。', 'desc', '2016-05-04', 287, NULL),
	(288, 'A', '35、读者在借书时，应该注意检查图书是否有污损、缺页等情况，如有问题，应及时向工作人员提出，以避免不必要的纠纷。这种说法（ ） 。', 'desc', '2016-05-04', 288, NULL),
