	(392, 'C', '70、有一组图书，其索书号分别为H/1，H-66/1，H0/1，H12/1，H114/1，这组图书正确的上架顺序（ ） 。', 'desc', '2016-05-05', 392, NULL),
	(393, 'A', '1、读者使用我馆电子阅览室的电脑，按1元/小时收取工本费。这种说法（ ） 。', 'desc', '2016-05-05', 393, NULL),
	(394, 'A', '2、遗失图书，有两种赔偿方式：一是可以购买同题名同作者同出版社的正版新书，并交纳书刊加工费5元/册；二是根据图书出版年份的远近，按图书价格的3—10倍赔偿。这种说法（ ） 。', 'desc', '2016-05-05', 394, NULL),
	(395, 'A', '3、读者在利用图书馆时，一卡通帐号登录出现了问题，可以找图书馆网络信息部解决。这种说法（ ） 。', 'desc', '2016-05-05', 395, NULL),
	(396, 'A', '4、通过图书馆主页“书目查询”搜索图书，在该图书的书目信息下点击“随书光盘下载”链接，直接下载所需光盘，还须在电脑上安装“网碟虚拟光驱”才能读出下载的光盘信息。这种说法（ ） 。', 'desc', '2016-05-05', 396, NULL),
	(397, 'A', '5、读者在校外也可以通过移动图书馆检索我馆的OPAC（书目查询系统），查询读者个人信息。这种说法（ ） 。', 'desc', '2016-05-05', 397, NULL),
	(398, 'B', '6、读者可以使用他人的校园一卡通借书。这种说法（ ） 。', 'desc', '2016-05-05', 398, NULL),
	(399, 'A', '7、学校图书馆已购买的电子资源对学校师生是免费使用的。这种说法（ ） 。', 'desc', '2016-05-05', 399, NULL),
	(400, 'A', '8、读者如果搜索到一篇文献，我馆没有购买全文，如果想获得全文，可以提交“文献传递”服务申请，通过邮箱接收全文。这种说法（ ） 。', 'desc', '2016-05-05', 400, NULL),
	(401, 'A', '9、读者可以登录湖南人文科技学院图书馆公众微信号，获知节假日开馆时间、活动信息、数据库试用的最新消息。这种说法（ ） 。', 'desc', '2016-05-05', 401, NULL),
	(402, 'B', '10、我校图书馆的资源和服务只对校内师生读者，不对校外人士提供。这种说法（ ） 。', 'desc', '2016-05-05', 402, NULL),
	(403, 'A', '11、读者可以登录图书馆主页，获知节假日开馆时间、活动信息、数据库试用的最新消息。这种说法（ ） 。', 'desc', '2016-05-05', 403, NULL),
	(404, 'A', '12、“真人图书馆”是由我馆主办、大学生科技协会承办的一个以真人为图书，通过面对面交流的方式阅读真人独特人生故事的活动。这种说法（ ） 。', 'desc', '2016-05-05', 404, NULL),
	(405, 'A', '13、“教授博士名家讲坛”是我馆举办的一个学术讲座栏目，通常在图书馆415学术交流中心进行，届时会在图书馆大厅入口处张贴活动海报，在图书馆网站、电子显示屏、微信平台上发布活动信息，有兴趣的老师和学生都可以参加。这种说法（ ） 。', 'desc', '2016-05-05', 405, NULL),
	(406, 'A', '14、储藏在院系图书资料室的图书，只对本校教职工开放。这种说法（ ） 。', 'desc', '2016-05-05', 406, NULL),
	(407, 'A', '15、我校师生如果要向图书馆捐赠图书，应该联系图书馆馆办公室或文献资源建设部。这种说法（ ） 。', 'desc', '2016-05-05', 407, NULL),
	(408, 'A', '16、图书馆是重点防火单位，严禁携带易燃易爆物品入馆，严禁在馆内任何地方吸烟、用火。这种说法（ ） 。', 'desc', '2016-05-05', 408, NULL),
	(409, 'B', '17、读者到图书馆自习，可以用书占座位。这种说法（ ） 。', 'desc', '2016-05-05', 409, NULL),
	(410, 'A', '18、“一校一书——经典、精读、经世”阅读活动是湖南省高校图工委组织全省高校协同开展的一个共同阅读项目，于每年的4月份启动，12月份结束。这种说法（ ） 。', 'desc', '2016-05-05', 410, NULL),
	(411, 'A', '19、“文学名著电影欣赏节”是我校图书馆举办的一项融名著阅读、电影欣赏、影评书评征文于一体的阅读推广活动。这种说法（ ） 。', 'desc', '2016-05-05', 411, NULL),
	(412, 'B', '20、图书馆图书排架的依据是条码号。这种说法（ ） 。', 'desc', '2016-05-05', 412, NULL),
	(413, 'A', '21、索书号由分类号、书次号组成，分类号代表图书内容所属的学科类目，书次号有种次号、著者号和年代号三种，我馆采用的是种次号。这种说法（ ） 。', 'desc', '2016-05-05', 413, NULL),
	(414, 'A', '22、我馆图书在书架上的排列位置先按分类号排列，分类号相同再按种次号大小排列。这种说法（ ） 。', 'desc', '2016-05-05', 414, NULL),
	(415, 'A', '23、图书馆图书排序的一般规律是先按照分类号排序，其规则是对同级类目进行一对一的比较和排序，而不是完全按照数字的大小顺序来排序。比如，H12和H3，在这两个分类号中，H是一级类目[即语言学类]，1和3是二级类目，2是三级类目。因此，对这两个分类号的排序方式是，将H1和H3进行比较，H12排在H3的前面。这种说法（ ） ', 'desc', '2016-05-05', 415, NULL),
	(416, 'A', '24、我馆自习室暑假开放，寒假不开放。这种说法（ ） 。', 'desc', '2016-05-05', 416, NULL),
	(417, 'B', '25、我馆图书借还实行分借分还书制。这种说法（ ） 。', 'desc', '2016-05-05', 417, NULL),
	(418, 'A', '26、读者所借图书，可以续借一次，续借手续应在图书到期日前办理。续借手续可以在大厅还书总台办理，也可以登录“我的图书馆”或通过我馆微信公众号自行办理。这种说法（ ） 。', 'desc', '2016-05-05', 418, NULL),
	(419, 'A', '27、图书馆十分重视读者对图书及期刊的推荐意见。读者可直接来图书馆文献资源建设部（图书馆605室）推荐图书，也可通过图书馆主页上的读者荐购栏目提供推荐信息。这种说法（ ） 。', 'desc', '2016-05-05', 419, NULL),
	(420, 'A', '28、我馆对图书的分类采用《中国图书馆图书分类法》（简称《中图法》）。《中图法》把所有学科分为五个基本部类，在此基础上展开为22个基本大类，用22个大写汉语拼音字母来标记，如：文学类图书为“I”；数理化类图书为“O”；计算机类图书为“TP”等。这种说法（ ） ', 'desc', '2016-05-05', 420, NULL),
	(421, 'A', '29、图书经过分类后，同一门类的图书排列在一起，性质相近的图书互相联系，读者要想借阅哪方面的图书，便可按类查找，并可从分类体系中了解到内容相近的其他图书。这种说法（ ） ', 'desc', '2016-05-05', 421, NULL),
	(422, 'A', '30、《微机使用技巧与实用程序》的索书号是TP3/156，“TP3”是该书的分类号→表示该书所属的类目：计算机技术；“156”是“TP3”的第156种图书→表示该书在同一种类（TP3）图书中的排架顺序号。这种说法（ ） ', 'desc', '2016-05-05', 422, NULL),
	(423, 'A', '31、图书馆的所有图书都是按索书号顺序从左到右、从上到下进行排架。排序的一般规律是先按照分类号排序，然后再按照种次号排序。种次号表示的是同类图书到馆的先后次序，排架时按照数字的大小顺序，从小到大排列。如索书号为I247.5/23的图书排在索书号为I247.5/21的后面。这种说法（ ） 。', 'desc', '2016-05-05', 423, NULL),
	(424, 'A', '32、图书馆主要通过面对面咨询、邮件咨询、电话咨询、留言板、FAQ等服务方式来解答读者在使用图书馆时所遇到的问题。这种说法（ ） 。', 'desc', '2016-05-05', 424, NULL),
	(425, 'A', '33、对读者经常会遇到并提问的问题，图书馆已经整理了“常见问题（FAQ）”、“电子资源利用（FAQ）”、“流通阅览（FAQ）”，读者可以从这些FAQ中找到某些问题的答案。这种说法（ ） 。', 'desc', '2016-05-05', 425, NULL),
	(426, 'A', '34、读者在进行书目查询时，应该记录书名、馆藏地点、索书号等图书信息，再到相应的馆藏地点取书并办理借书手续。这种说法（ ） 。', 'desc', '2016-05-05', 426, NULL),
	(427, 'A', '35、读者在借书时，应该注意检查图书是否有污损、缺页等情况，如有问题，应及时向工作人员提出，以避免不必要的纠纷。这种说法（ ） 。', 'desc', '2016-05-05', 427, NULL);
